import * as React from 'react';
import AppBar from '@mui/material/AppBar';
import Box from '@mui/material/Box';

import './Nav.css'







function Navbar() {
    function searchFun() {
        let x=document.getElementById("s1").value
        console.log(x);
        
    }

    const [data, setData] = useState([]);
    useEffect(async () => {
        let result = await fetch('http://localhost:3000/List');
        result = await result.json();
        setData(result)

    }, [])
    console.log("data", data);

  return (

<div class="navDiv">
    
    <Box class="navColor">
        <Box class="navItemBox1">Our Logo</Box>
        <Box class="navItemBox5">
        <select  class="navItemBox" >
            <option>Infocity Squre</option>
            <option>Trident Collage</option>
            <option>Sai Enclivs</option>
        </select>
            </Box>
        <Box class="navItemBox3">Login</Box>
    </Box>
</div>
  

  )
}

export default Navbar
